import axios from 'axios';

const Home = (props) => {
    const [data,setDate] = useState([]);
    useEffect (()=>{
        axios.get ('http://localhost:9000/get-data')
        .then(res =>{
            console.log(res);
            setDate(res.data)
        })
    },[])
  return (

    <ul>
    {Array.from(data).map((item,index) => (
      <div key={index}>
      <li>{item.message}Salam</li>
      <li>{props.value}</li>
      <li>{item.job}</li>
      </div>
  ))}
    </ul>
  )

}

export default Home;
